        <item><title><![CDATA[Intervija ar ministru prezidentes amata kandidāti Eviku Siliņu]]></title><category>Kāpēc</category><enclosure url="http://g.delfi.lv/images/pix/420x0/i_5larerhpc/kapec-podkasts-54096364.jpg" type="image/png" /><link>https://www.delfi.lv/podkasti/kapec/intervija-ar-ministru-prezidentes-amata-kandidati-eviku-silinu.d?id=55859226</link><guid>https://www.delfi.lv/podkasti/kapec/intervija-ar-ministru-prezidentes-amata-kandidati-eviku-silinu.d?id=55859226</guid><description><![CDATA[Līdzšinējam ministru prezidentam Krišjānim Kariņam (JV) atkāpjoties no amata, &quot;Jaunā Vienotība&quot; (JV) kā nākamo šī amata kandidāti izvirzījusi pašreizējo labklājības ministri Eviku Siliņu. Kā politiķe Kā Siliņa veidos un vadīs jauno valdību – par to &quot;Delfi TV&quot; raidījumā &quot;Kāpēc&quot; ar Siliņu sarunājās žurnāliste Olga Dragiļeva.]]></description><media:content url="http://g.delfi.lv/images/pix/420x0/i_5larerhpc/kapec-podkasts-54096364.jpg" /><slash:comments>0</slash:comments><pubDate>Fri, 18 Aug 2023 16:52:13 +0300</pubDate></item>
